import * as db from '@db';
import { UserError } from '@errors';
import { constants } from '@utils';
import { faker } from '@faker-js/faker/locale/en';
import * as APITypes from '@apiTypes';
import { ACCCache } from '@cache';

/*
 * Add X Patterns
 */
async function patterns({amount})
{
	// You must be logged in and on a test site
	if (constants.LIVE_SITE)
	{
		throw new UserError('permission');
	}

	if (!this.userId)
	{
		throw new UserError('login-needed');
	}

	// Perform queries
	const staffUserIds = await db.query(`
		SELECT users.id
		FROM users
		JOIN user_group ON (user_group.id = users.user_group_id)
		JOIN user_group AS staff_group ON (user_group.parent_id = staff_group.id)
		WHERE staff_group.identifier = 'staff'
	`);

	const dataUrl = 'data:image/png;base64,';
	const paletteId = 1;
	const qrCodeUrl = 'data:image/png;base64,';
	const data = '';

	for (let i = 0; i < amount; i++)
	{
		const patternUserId = faker.helpers.arrayElement(staffUserIds).id;
		const patternName = faker.random.words();

		await db.query(`
			INSERT INTO pattern (name, creator_id, published, design_id, data, data_url, game_id, palette_id, qr_code_url)
			VALUES ($1, $2::int, $3::bool, $8, $4, $5, $6::int, $7::int, $9)
		`, patternName, patternUserId, false, data, dataUrl, constants.gameIds.ACNH, paletteId, null, qrCodeUrl);
	}

	ACCCache.deleteMatch(constants.cacheKeys.patterns);

	return {
		_success: `Your pattern(s) have been created!`
	};
}

patterns.apiTypes = {
	amount: {
		type: APITypes.number,
		required: true,
		max: 100,
		min: 1,
	},
}

export default patterns;